 *     BSI Business Systems Integration AG - initial API and implementation
 */
import $ from 'jquery';

export default class LookupRow {

  constructor() {
    this.key = null;
    this.text = null;
    this.parentKey = null;
    this.enabled = true;
    this.active = true;
    this.additionalTableRowData = null;
    this.cssClass = null;
    this.iconId = null;
    this.tooltipText = null;
    this.backgroundColor = null;
    this.foregroundColor = null;
    this.font = null;
  }

  init(model) {
    $.extend(this, model);
  }

  setKey(key) {
    this.key = key;
  }

  setText(text) {
    this.text = text;
  }

  setParentKey(parentKey) {
    this.parentKey = parentKey;
  }

  setCssClass(cssClass) {
    this.cssClass = cssClass;
  }

  setAdditionalTableRowData(additionalTableRowData) {
    this.additionalTableRowData = additionalTableRowData;
  }

  setIconId(iconId) {
    this.iconId = iconId;
  }

  setTooltipText(tooltipText) {
    this.tooltipText = tooltipText;
  }

  setBackgroundColor(backgroundColor) {
    this.backgroundColor = backgroundColor;
  }

  setForegroundColor(foregroundColor) {
    this.foregroundColor = foregroundColor;
  }

  setFont(font) {
    this.font = font;
  }

  toString() {
    return 'scout.LookupRow[key=' + this.key + ' text=' + this.text + ']';
  }
}
